window.App=window.App||{},window.App.Utils={runCopyrightYearScript:function(){[...document.querySelectorAll("[data-copyright-year]")].forEach(el=>el.textContent=(new Date).getFullYear())},runDateZeroScript:function(){document.querySelectorAll("[data-dt-date-zero]").forEach(node=>{var day,month,parts=node.textContent.trim().split("/");3===parts.length&&(day=parts[0].padStart(2,"0"),month=parts[1].padStart(2,"0"),parts=parts[2],node.textContent=day+`/${month}/`+parts)})},initializePageScripts:function(){document.body.classList.contains("contact-page")}};